import React from "react";
import NorthP from "./image/north.jpg"
import SouthP from "./image/south.jpg"


const HemisphereDisplay = ({ latitude }) => {

    /// ternary expression
    const hemisphere = latitude > 0 ? 'Northern Hemisphere' : 'Southern Hemisphere';
    const picture = latitude > 0 ? NorthP : SouthP;

    return(

        <div>
            <img src={ picture } alt="" />
            { hemisphere }
        </div>
    )
}

export default HemisphereDisplay;
